import React,{useState} from 'react'
import Admin from './pages/Admin';
import Login from './components/Login';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Routes ,Route } from 'react-router-dom';
import Register from './components/Register';
import ViewOrder from './pages/ViewOrder';
import Home from './pages/Home';
function App() {

  const [user, setUser] = useState()

  const order = (data) =>{
    console.log(data);
  }

  const loginUser=(user)=>{
    console.log(user);
    setUser(user)
  }
  return (
    <>
      <Routes>
        <Route exact path='/' element={<Login loginUser={loginUser}/>}></Route>
        <Route exact path='/admin' element={<Admin user={user}/>}></Route>
        <Route exact path='/register' element={<Register/>}></Route>
        <Route exact path='/view-order' element={<ViewOrder/>}></Route>
        <Route exact path='/home' element={<Home order={order}/>}></Route>

      </Routes>
    </>
  )
}

export default App
